{
  "$schema": "https://openapi.vercel.sh/vercel.json",
  "outputDirectory": "public",
  "rewrites": [
    {
      "source": "/",
      "destination": "/api/frameworks"
    },
    {
      "source": "/api/v1/frameworks",
      "destination": "/api/frameworks"
    },
    {
      "source": "/api/examples/list",
      "destination": "/list.json"
    },
    {
      "source": "/api/examples/list-all",
      "destination": "/list-all.json"
    }
  ],
  "github": {
    "silent": true,
    "autoJobCancelation": true
  },
  "headers": [
    {
      "source": "/api(/v[0-9]+)?/frameworks",
      "headers": [
        {
          "key": "cache-control",
          "value": "public, max-age=60, s-maxage=500, stale-while-revalidate=500, stale-if-error=500"
        }
      ]
    },
    {
      "source": "/api/examples(.*)",
      "headers": [
        {
          "key": "cache-control",
          "value": "public, max-age=60, s-maxage=86400, stale-while-revalidate=86400, stale-if-error=86400"
        }
      ]
    }
  ]
}

import { defineConfig } from 'vite';
import VitestReporter from './test/lib/vitest-reporter';

export default defineConfig({
  test: {
    reporters: [new VitestReporter()],
    // Use of process.chdir prohibits usage of the default "threads". https://vitest.dev/config/#forks
    pool: 'forks',
    env: {
      // Vitest supresses color output when `process.env.CI` is true
      // so override that behavior
      // Issue: https://github.com/vitest-dev/vitest/issues/2732
      // Fix: https://github.com/JoshuaKGoldberg/expect-no-axe-violations/pull/3/files
      FORCE_COLOR: '1',
    },
    hideSkippedTests: true,
    exclude: [
      // default
      '**/node_modules/**',
      '**/dist/**',
      '**/cypress/**',
      '**/.{idea,git,cache,output,temp}/**',
      '**/{karma,rollup,webpack,vite,vitest,jest,ava,babel,nyc,cypress,tsup,build}.config.*',
      // some artifacts in the fixtures have spec files that we're not using
      '**/*.spec.js',
    ],
  },
});
